switch(action.type) {

  case SUBSCRIPTION_SUCCESS:
    console.log("SUB-SUCESS", action.payload);
    return {...state, processingSubscription: false}
  case "PENDING":
  return {...state, processingSubscription: true}
  case "ERROR":
  console.log("SUB-ERROR", action.payload);
    return {...state, error: true}
    default:
    return state;
  }
}
